import React from 'react';
import Card from '../../components/Card/Card';
import './Account.css';

const Profile = () => {
  const userProfile = {
    name: "John Doe",
    email: "john@example.com",
    department: "Computer Science",
    role: "Student Athlete",
    sports: ["Basketball", "Cricket"],
    registrations: [
      {
        id: 1,
        event: "Inter-Department Basketball Championship",
        date: "2024-03-20",
        status: "Confirmed"
      },
      {
        id: 2,
        event: "Cricket Tournament",
        date: "2024-03-28",
        status: "Pending"
      }
    ]
  };

  return (
    <div className="account-container">
      <h1>My Profile</h1>
      
      <div className="profile-grid">
        <Card>
          <div className="profile-info">
            <h2>Personal Information</h2>
            <div className="info-group">
              <label>Name:</label>
              <span>{userProfile.name}</span>
            </div>
            <div className="info-group">
              <label>Email:</label>
              <span>{userProfile.email}</span>
            </div>
            <div className="info-group">
              <label>Department:</label>
              <span>{userProfile.department}</span>
            </div>
            <div className="info-group">
              <label>Role:</label>
              <span>{userProfile.role}</span>
            </div>
          </div>
        </Card>

        <Card>
          <div className="registrations-list">
            <h2>My Registrations</h2>
            {userProfile.registrations.map(reg => (
              <div key={reg.id} className="registration-item">
                <h3>{reg.event}</h3>
                <p>Date: {reg.date}</p>
                <span className={`status ${reg.status.toLowerCase()}`}>
                  {reg.status}
                </span>
              </div>
            ))}
          </div>
        </Card>
      </div>
    </div>
  );
};

export default Profile;
